1.body:
To improve performance of database access and during network transmission tapir is using a lightweight representation of Article in some places. Depending on the service used to retrieve an article, the Article message might only contain data required on section pages (e.g. with Article.body set to null thus not containing any data that is only required on detail pages). This lightweight representation is sometimes referred to as Teaser. Field name Type Description id int64 Unique ID of the article defined by the content management system (required). type Type Main content type of the article (required). See list of supported [ContentType][ct] sub_type SubType Subtype of the article. For ARTICLE this field holds a sub_type, for others like GALLERY it may not. section_tree Reference Hierarchical section tree information of the article (required). fields map<string, string> Generic map containing general content and configuration information of the article (required). See fields bodies repeated Body Recursive textual body of the article to be rendered on detail pages. May be null for Teaser . elements repeated Element Elements required to render the teaser, such as IMAGE, VIDEO or AUTHOR keywords repeated Keyword Extracted keywords from the article body like persons, locations, organizations etc. onwards int64 IDs of articles related to this article. Related articles are defined manually in the content management system by the editorial department. entities string [deprecated] Extracted entities from the article body like persons, locations, organizations etc. deprecated — use keywords instead. message Article {
int64 id = 1;
Type type = 2;
SubType sub_type = 3;
stroeer.core.v1.Reference section_tree = 4;
map<string, string> fields = 5;
repeated Body bodies = 6;
Metadata metadata = 7;
repeated Element elements = 8;
repeated Keyword keywords = 9;
repeated int64 onwards = 10;
repeated string entities = 100 [deprecated = true]; [~]

101.body:
type description image inline image element, check elements video inline video element, check elements gallery inline gallery element, check elements oembed inline oEmbed element, check elements esi inline edge side include element, check elements quote inline quotation element, check elements infobox inline box, consists of textual content in children and optional elements pros_and_cons pros and cons box, consists of elements and structured text in children [~] [~] The Body represents a basic block. Each Body is self-contained and holds all the data required for rendering within its data structures. Common use cases for this are Type.BODY where the textual article body can be found and the TYPE.ARTICLE_SOURCE where onward articles are referenced. Field name Type Description children repeated BodyNode Recursive/Nested structure that usually represents the textual body / Markup / HTML type Type Unique ID of the article defined by the content management system (required). message Body {
repeated BodyNode children = 1;
Type type = 2; [~]

102.body:
Each Body has a Body.Type to help the consumer to correctly interpret the BodyNode's content. Enum value Description TYPE_UNSPECIFIED unspecified BODY The textual article body including all inline elements such as IMAGE, VIDEO and EMBED ARTICLE_SOURCES A wrapper for all article sources ("Quellenaparat"). There can only be one of these per article. DISCLAIMER A article disclaimer with important notes/legal stuff. E.g. "medizinischer Hinweis" on all medical articles TRUST_BOX Includes information what the current article type is (e.g. opinion article). There can only be one of these per article. TABLE_OF_CONTENTS Table of contents for this article, consists of anchors which refer to sub headlines within the BODY enum Type {
TYPE_UNSPECIFIED = 0;
BODY = 1;
ARTICLE_SOURCES = 2;
DISCLAIMER = 3;
TRUST_BOX = 4;
TABLE_OF_CONTENTS = 5;
} [~]

103.body:
Recursive structure representing all types of possible nodes inside an article. One use-case is to represent HTML-like markup in tapir, but it is also used to map custom elements that require a strict positional placement within the textual body. Things that are not part of the textual article body are represented as individual Body parts so they can be rendered independently if required. Clients must be resilient to unknown or missing nodes. message BodyNode {
string type = 1;
string text = 2;
map<string, string> fields = 3;
repeated BodyNode children = 4;
repeated Element elements = 5;
} [~] Field name Type Description type string Type of the node (required). text string Text of the node, only set for text nodes (type == 'text'). fields map<string, string> Additional information for the node depending on it's type, e.g. href for a nodes. See fields children repeated BodyNode Nested Items, e.g. the text of a <p> or a <a>. elements repeated Element Elements of the node, e.g. video, image, gallery, embed, ...

