12.body:
Content with Type.ARTICLE is usually sub typed to alter its form and purpose. Enum value Description SUB_TYPE_UNSPECIFIED unspecified NEWS Meldung/Nachricht — this is the default COLUMN Kolumne COMMENTARY Kommentar INTERVIEW Interview CONTROVERSY Pro und Kontra/Streitgespräch TAGESANBRUCH Tagesanbruch EVERGREEN Evergreen AGENCY_IMPORT Content originally imported from agency/tickers by the CMS ADVERTORIAL Advertorial QUIZ Quiz GAME (Browser)Game COMPLIANCE Internal company articles like an imprint or contact forms enum SubType {
SUB_TYPE_UNSPECIFIED = 0;
NEWS = 1;
COLUMN = 2;
COMMENTARY = 3;
INTERVIEW = 4;
CONTROVERSY = 5;
TAGESANBRUCH = 6;
EVERGREEN = 7;
AGENCY_IMPORT = 8;
ADVERTORIAL = 9;
QUIZ = 10;
GAME = 11;
COMPLIANCE = 12;
} [~] [~] An article represents a piece of content created in the content management system. Different types of content like text or video articles share the same message structure, they can be distinguished by the Article.Type field. Text articles (type = Article.Type.ARTICLE) also have Article.SubType to differentiate its purpose and form.

122.body:
Elements are self-contained objects that represent structured data that is usually too complex to fit into our usual workhorse which is the Body . Elements can appear in multiple places within the Article: Article.elements Elements of the article which are not part of the textual body, e.g. author, opener and teaser. Those elements should be used to render the article as a teaser e.g. on section pages. BodyNode.children: Is the place where Element are quite commonly used. They come in various types and will be rendered inplace, thus breaking up the textual body. Elements.children: Some more sophisticated Elements make use of nesting to make their API representation more concise and help to structure things hierarchically: video uses nesting to model its optional poster image which itself is a normal image. galleries have their individual images nested within. Different types of elements like images or videos share the same message structure distinguished by the ElementType field. See Sample section. Field name Type Description type Type type of this Element, see Element.Type relations repeated Relation The usages (relations) of an element. See Relation assets repeated Asset Assets describing this Element, See Samples children repeated Element nested Elements, e.g. for Element of type gallery and video message Element {
Type type = 1;
repeated Relation relations = 2;
repeated Asset assets = 3;
repeated Element children = 4; [~]

