State of the item ( Article , Element ) in the content management system. The state in combination with start_time and end_time determines whether or not this item should be rendered; this must be respected by all consumers especially when content is duplicated or cached. The terms deleted (articles) and archived (media lib) are interchangeable/synonyms. This enum combines those two into State.DELETED. An Article is in State.DELETED if it was deleted in the content management system, or if it's end_time has been reached. An Article is in State.DRAFT if it has never been published, or if the start_time lies in the future. Enum value description STATE_UNSPECIFIED unspecified PUBLISHED published content which is currently within its validity dates DELETED this content is deleted or expired in the CMS DRAFT this content was never published in the CMS enum State {
STATE_UNSPECIFIED = 0;
PUBLISHED = 1;
DELETED = 2;
DRAFT = 3;
} [~]

