Specify the search criteria. The list-API is build around sections which come in two flavors: home_section: find all articles that resides within that exact section. The home_section is equal to the settings found in the CMS, e.g. /nachrichten/wissen/ root_section: this property is derived from the home_section path by retaining only the root folder, e.g. for /nachrichten/wissen/ the root_section becomes /nachrichten/ In most cases using the root_section should yield better results since it will also find content in nested sections whereas home_section would only return content which was curated into the exact section that was queried. Field name Type Description path string [required] path, with leading and trailing slash (e.g. /nachrichten/) type Type [required] query type, either Type.HOME_SECTION or Type.ROOT_SECTION sort_by SortBy [required] sorting of the result set, either SortBy.UPDATE_TIME or SortBy.PUBLISH_TIME order Order [optional] sorting direction for the results regarding the sort_by field, default is Order.ASCENDING from_time Timestamp [optional] time constraint that refers to the sort_by field. to_time Timestamp [optional] time constraint that refers to the sort_by field. message Query {
string path = 1;
Type type = 2;
SortBy sort_by = 3;
Order order = 4;
