To improve performance of database access and during network transmission tapir is using a lightweight representation of Article in some places. Depending on the service used to retrieve an article, the Article message might only contain data required on section pages (e.g. with Article.body set to null thus not containing any data that is only required on detail pages). This lightweight representation is sometimes referred to as Teaser. Field name Type Description id int64 Unique ID of the article defined by the content management system (required). type Type Main content type of the article (required). See list of supported [ContentType][ct] sub_type SubType Subtype of the article. For ARTICLE this field holds a sub_type, for others like GALLERY it may not. section_tree Reference Hierarchical section tree information of the article (required). fields map<string, string> Generic map containing general content and configuration information of the article (required). See fields bodies repeated Body Recursive textual body of the article to be rendered on detail pages. May be null for Teaser . elements repeated Element Elements required to render the teaser, such as IMAGE, VIDEO or AUTHOR keywords repeated Keyword Extracted keywords from the article body like persons, locations, organizations etc. onwards int64 IDs of articles related to this article. Related articles are defined manually in the content management system by the editorial department. entities string [deprecated] Extracted entities from the article body like persons, locations, organizations etc. deprecated — use keywords instead. message Article {
int64 id = 1;
Type type = 2;
SubType sub_type = 3;
stroeer.core.v1.Reference section_tree = 4;
map<string, string> fields = 5;
repeated Body bodies = 6;
Metadata metadata = 7;
repeated Element elements = 8;
repeated Keyword keywords = 9;
repeated int64 onwards = 10;
repeated string entities = 100 [deprecated = true]; [~]

